import React, { Component } from 'react';
import './style.css';

export class Searchbar extends Component {
    render() {
        return (
            <section>
                <div classname="container container-fluid">
                    <div classname="d-flex flex-row justify-content-center">
                        <h1 classname="sub-title flex-item">Check out these Huskies!</h1>
                    </div>
                </div>
                <div classname="wrapper">
                    <div classname="search-box">
                        <input type="text" placeholder="Search for a classname name" id="search-input" aria-label="Search"></input>
                        <a classname="search-icon" href="#" role="button" id="searchicon"><i classname="fas fa-search"></i></a>
                    </div>
                </div>
            </section>
        )
    }
}
